  \"Contaminants in peregrine falcon (Falco peregrinus) eggs from Virginia, Maryland
  and West Virginia\",\n\t\"tracking_summary\": {\n\t\t\"total\": 10,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:41:53.754160\",\n\t\"name\": \"contaminants-in-peregrine-falcon-falco-peregrinus-eggs-from-virginia-maryland-and-west-vir\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Peregrine falcons were extirpated in the
  eastern United States in the 1960s principally due to the use of organochlorine
  pesticides, particularly DDT (Peakall et al., 1975). The reintroduction of peregrine
  falcons has successfully established breeding populations along the East Coast (Cade,
  1985; Barclay, 1988). The possible impact of environmental contaminants on these
  newly established populations continues to be of concern. Inviable peregrine eggs
  from 8 nests in Virginia, Maryland, and West Virginia were collected in 1992. All
  11 egg samples contained measurable concentrations of DDE. DDE concentrations ranged
  from 0.97 parts per million (ppm) to 11.7 ppm (adjusted wet weight), with a geometric
  mean concentration of 3.2 ppm. Dieldrin was also found in all eggs, and displayed
  a geometric mean residue of 0.3 ppm, adjusted wet weight (range 0.09 to 1.1 ppm).
  DDE concentrations of 1.2 to 30 ppm wet weight and dieldrin concentrations of 1
  ppm are associated with adverse effects on reproduction in peregrines (Fyfe et.
  a1., 1988 and Wiemeyer et. al., 1986). Mercury residues were also elevated in one
  sample (0.61 ppm, wet weight). Egg shells were found to display thinning up to 26.9%,
  a level above the reported 14% to 17% range that results in egg failure (Fyfe et.
  a1., 1988; Peakall and Kiff, 1988). The results of this study indicate possible
  reproductive problems, which may be attributable to environmental contaminants.
  Most compounds of concern were present in concentrations just below the level thought
  to be critical in inducing adverse effects on avian health. The small sample size
  does not allow for a full assessment of the impacts of environmental contaminants
  on peregrine falcons of coastal Maryland and Virginia. Additional monitoring of
  peregrine eggs combined with the establishment of a database that compiles all contaminant
  and population information is recommended.\",\n\t\"license_title\": \"License Not
